import React from "react";

const SubTitle = (tilte , btntitle) => {
  return (

    <div className="d-flex justify-content-between pt-4">
      <div className="sub-tile">{tilte}</div>

      { btntitle ? (
        <div className="shopping-now">{mmmm}</div>
      ) : (null)
        
      }
          
     
    </div>
  );
}

export default SubTitle;
